import React from 'react';
import './YourOrder.css';
const YourOrder: React.FC = () => {
	return (
		<div id="your-order">
			<hr className="the-order" />
			<div className="bag">
				<div id="info">Contact Us</div>
				<div id="info"> Term of Use</div>
				<div id="info">Privacy Policy</div>
			</div>
		</div>
	);
};

export default YourOrder;
